import React from 'react';

class Header extends React.Component {
  render() {
    return (
      <header className="top">
        <h1>Cath of the Day</h1>
        <h3 className="tagline"><span>Fresh Daily</span></h3>
      </header>
    )
  }
}

export default Header;
